const hashed = '$2b$10$wnBcdUK16a8R7DL8BuRf8eN1FOcSISGp0Yk/3qpF4EobzKXTzALrW';

bcrypt.compare('12345', hashed).then(result => {
  console.log("Password corretta?", result);
});
